'use strict';
addPageScript(function(){

	setTimeout(function(){$(".alertMessage").hide();}, 3000);
    
    $('#multi-colum-dt').DataTable({
            columnDefs: [{
                targets: [0],
                orderData: [0, 1]
            }, {
                targets: [1],
                orderData: [1, 0]
            }, {
                targets: [3],
                orderData: [3, 0]
            }]
    });

    $(".numeric").on("keypress keyup blur",function (event) {    
           $(this).val($(this).val().replace(/[^\d].+/, ""));
           if ((event.which < 48 || event.which > 57)) {
                event.preventDefault();
           }
    });

    $('.decimal').on("keypress keyup blur", function(){
		    var val = $(this).val();
		    if(isNaN(val)){
		         val = val.replace(/[^0-9\.]/g,'');
		         if(val.split('.').length>2) 
		             val =val.replace(/\.+$/,"");
		    }
		    $(this).val(val); 
    });

    $('.alphaNumeric').keypress(function (e) {
	        var regex = new RegExp("^[0-9a-zA-Z]+$");
	        var str = String.fromCharCode(!e.charCode ? e.which : e.charCode);
	        if (regex.test(str)) {
	            return true;
	        }
	        e.preventDefault();
	        return false;
    });

     $('.alphaNumericSpace').keypress(function (e) {
	        var regex = new RegExp("^[0-9a-zA-Z ]+$");
	        var str = String.fromCharCode(!e.charCode ? e.which : e.charCode);
	        if (regex.test(str)) {
	            return true;
	        }
	        e.preventDefault();
	        return false;
    });


    $(function() {
        // [ Add phone validator ]
        $.validator.addMethod(
            'phone_format',
            function(value, element) {
                return this.optional(element) || /^\(\d{3}\)[ ]\d{3}\-\d{4}$/.test(value);
            },
            'Invalid phone number.'
        );

        jQuery.validator.addMethod("alphanumeric", function(value, element) {
		    return this.optional(element) || /^\w+$/i.test(value);
		    }, "Please enter only Letters, numbers and underscores");

		});

        jQuery.validator.addMethod("nameRegex", function(value, element) {
    	        return this.optional(element) || /^[a-z0-9\ \s]+$/i.test(value);
    	}, "Please enter only Letters, numbers & space");

    	jQuery.validator.addMethod("nameRegexComma", function(value, element) {
    	        return this.optional(element) || /^[a-z0-9\ \s,]+$/i.test(value);
    	}, "Please enter only Letters, numbers, Comma & space");

    	jQuery.validator.addMethod("nameRegexPercentage", function(value, element) {
    	        return this.optional(element) || /^[a-z0-9-.%\ \s,]+$/i.test(value);
    	}, "Please enter only Letters, numbers, Comma, Hyfun, Percentage & space");

    	jQuery.validator.addMethod("alphaRegex", function(value, element) {
    	        return this.optional(element) || /^[a-z]+$/i.test(value);
    	}, "Please enter only Letters");

    	jQuery.validator.addMethod("alphaSpaceRegex", function(value, element) {
    	        return this.optional(element) || /^[a-z\ \s]+$/i.test(value);
    	}, "Please enter only Letters & Space");

    	jQuery.validator.addMethod("numbers", function(value, element) {
    	        return this.optional(element) || /^[0-9]+$/i.test(value);
    	}, "Please enter only numbers");

    	$.validator.addMethod("isFileDirectory", function(value, element) {
		    return this.optional(element) || isFile(value); 
		}, "InValid Directory");

    	$.validator.addMethod("isFileValid", function(value, element) {
		    return this.optional(element) || /^[0-9a-zA-Z<>_-]*\.(?:csv|xls|xlsx|txt|lst)$/i.test(value);
		}, "Incorect file type");

		$.validator.addMethod('filesize', function(value, element, param) {
           return this.optional(element) || (element.files[0].size <= param);
        }, "File size exceeds 1 MB");

        $.validator.addMethod("gstIn", function(value3, element3) {
		    var gst_value = value3.toUpperCase();
		    var reg = /^([0-9]{2}[a-zA-Z]{4}([a-zA-Z]{1}|[0-9]{1})[0-9]{4}[a-zA-Z]{1}([a-zA-Z]|[0-9]){3}){0,15}$/;
		    if (this.optional(element3)) {
		      return true;
		    }
		    if (gst_value.match(reg)) {
		      return true;
		    } else {
		      return false;
		    }
        }, "Please Enter Valid GSTTIN Number");

        $.validator.addMethod("pan", function(value, element){
	        return this.optional(element) || /^[A-Z]{5}\d{4}[A-Z]{1}$/.test(value);
	    }, "Invalid Pan Number");

	    $("button[type='reset']").on("click", function(){             
		      if($(".js-example-basic-single").length > 0){
		      	 $(".js-example-basic-single").val('').trigger('change');
		      	 setTimeout(function(){ $(".js-example-basic-single").val(''); }, 100);
		      }

		      if($("input[type='text']").length > 0){
		      	 setTimeout(function(){ $("input[type='text']").val('').trigger('change'); }, 100);
		      }

		      if($("textarea").length > 0){
		      	 setTimeout(function(){ $('textarea').val('').trigger('change'); }, 100);
		      }
		});

});


function isFile(value){
         if(/^(\\(\\[^\s\\]+)+|([A-Za-z]:(\\)?|[A-z]:(\\[^\s\\]+)+))(\\)?$/i.test(value)){
         	  return true;
         }else if(/^(\/[-\w^ ]+)+\/?([\w.])+[^.]$/i.test(value)){
         	  return true;
         }
         return false;
}


function multipleDataPostRedirect(formAction, jsonParam, jsonParamValue, method) {
        if (method == undefined) {
          method = "post";
        }
        var form = "<form action='" + formAction + "' method='" + method
            + "' id='insForm'>";
        var d = jsonParam.length;
        for (var b = 0; b < d; b++) {
          form = form + "<input type='hidden' name='" + jsonParam[b]
              + "' value=\"" + jsonParamValue[b] + '" />';
        }
        form = form + "</form>";
        $("body").append(form);
        $("#insForm").submit();
}

