 function isExistsMobileNumber(mobileInputId, mobileNumberValue){
     var mobileNumber = $("#"+mobileInputId).val();
     if(mobileNumber != undefined && mobileNumber != "" && mobileNumber != mobileNumberValue){
         $.ajax({
            type: "POST",
            url: basepath+"/rest/ajax/isExistsMobileNumber?mobileNumber="+mobileNumber,
            success: function (data) {
            	  if(data != undefined && data != "false"){
            	  	  $("#"+mobileInputId).val('');
	                  if(data == '0'){
	                     showErrMessage('Mobile Number Already Registered as Merchant', mobileInputId);
	                  }else if(data == '1'){
                         showErrMessage('Mobile Number Already Registered as Customer', mobileInputId);
	                  }else if(data == '2'){
                         showErrMessage('Mobile Number Already Registered', mobileInputId);
	                  }
	              }
            }
         });
    }
}


